import { AfterContentChecked, Component, ElementRef, OnInit, ViewChild } from '@angular/core';
import { ModalController } from '@ionic/angular';
import { ResultPage } from '../pages/result/result.page';
import SwiperCore, { SwiperOptions, Zoom } from 'swiper';
import { CropperPosition, LoadedImage } from '../interfaces';
import { Router } from '@angular/router';
SwiperCore.use([Zoom])

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage implements OnInit, AfterContentChecked {
  // myImage = 'data:image/jpeg;base64,'
  // myImage = `data:image/jpeg;base64,`
  // myImage = `data:image/jpeg;base64,`
  // myImage = `data:image/jpeg;base64,`

  // myImage = `data:image/jpeg;base64,`
  myImage = `data:image/jpeg;base64,`
  
  squareSize: number;
  cropper: CropperPosition = {
    x1: -100,
    y1: -100,
    x2: 10000,
    y2: 10000
  }
  mode: string;

  @ViewChild('imgInDiv') imgInDiv: ElementRef;

  config: SwiperOptions = {
    zoom: {
      maxRatio: 5,
    }
  }

  constructor(
    private modalCtrl: ModalController,
    private router: Router
  ) {}

  ngAfterContentChecked(): void {
    let content = document.getElementById("cropperIonContent") as HTMLElement
    this.mode = content.clientHeight > content.clientWidth ? 'potrait' : 'landscape'
    this.squareSize = this.mode == 'potrait' ? content.clientWidth : content.clientHeight

    if (content.clientHeight > 0 && content.clientWidth > 0) {
      let overlayCircleSize = this.squareSize * .8
      //potrait
      this.cropper = {
        x1: (content.clientWidth - overlayCircleSize)/2,
        y1: (content.clientHeight - overlayCircleSize)/2,
        x2: (content.clientWidth - overlayCircleSize)/2 + overlayCircleSize,
        y2: (content.clientHeight - overlayCircleSize)/2 + overlayCircleSize
      }
    }
  }

  ngOnInit(): void {
    
  }
  

  async goToResult() {
    //get translate3d style from swiper-zoom-container
    let swiperContainer = document.getElementsByClassName("swiper-zoom-container")[0] as HTMLElement
    let [xpx, ypx, zpx] = swiperContainer.style.transform.split("translate3d(").join("").split(")").join("").split(", ")
    let x:number = xpx? Number(xpx.split("px")[0]) : 0
    let y:number = ypx? Number(ypx.split("px")[0]) : 0


    //get scale style from ngx-ic-source-image
    let imageElement = document.getElementsByClassName("ngx-ic-source-image")[0] as HTMLImageElement
    let imageWidth = imageElement.width
    let imageHeight = imageElement.height
    let transform = imageElement.style.transform;

    let scale = "1"; //default


    //get scale if exist
    if (transform && transform.match(/\(\d*?.?\d*\)/))
      scale = imageElement.style.transform.match(/\(\d*?.?\d*\)/)[0]?.split("(")?.join("")?.split(")")?.join("");


    //return transform image in div
    let divwrapper = this.imgInDiv.nativeElement as HTMLElement;
    divwrapper.innerHTML = ''
    divwrapper.style.width = imageWidth + "px"
    divwrapper.style.height = imageWidth + "px"

    let newImg = document.createElement("img");
    newImg.src = this.myImage
    newImg.id = "newImg"

    console.log("imageWidth", imageWidth)

    // the height of image top to the circle (ypaddingtop)
    let cropperElement = document.getElementsByClassName('ngx-ic-cropper')[0] as HTMLElement
    let ypaddingtop = Number(cropperElement.style.top.split("px")[0])// (imageHeight - imageWidth)/2
    let xpaddingleft = Number(cropperElement.style.left.split("px")[0])
    let newYpx = ypx ? (y - ypaddingtop).toString() + 'px': (-1 * ypaddingtop).toString() + 'px'
    let newXpx = xpx ? (x + xpaddingleft).toString() + 'px': (1 * xpaddingleft).toString() + 'px'
    divwrapper.append(newImg)
    newImg.style.objectFit = 'cover'

    console.log("imageWidth", imageWidth, cropperElement.style.width)
    console.log("x",x, xpaddingleft, newXpx)

    //set the transform style to the img in div
    newImg.style.transform = `translate(${x}px, ${newYpx}) scale(${scale})`
    console.log("transform", newImg.style.transform)


    //draw image to canvas 
    var canvas = document.getElementById('finalCanvas') as HTMLCanvasElement;
    var ctx = canvas.getContext('2d');
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    var rect = newImg.getBoundingClientRect();
    console.log("rect", rect, rect.y - ypaddingtop, - ypaddingtop)
    ctx.drawImage(newImg, rect.x, rect.y - 44 , rect.width, rect.height)

    // console.log("===base64===")
    // // console.log(canvas.toDataURL('image/jpeg', 1.0));
    // console.log("===base64===")

    const modal = await this.modalCtrl.create({
      component: ResultPage,
      componentProps: {
        image:  canvas.toDataURL('image/jpeg', 1.0)
      },
      cssClass: 'my-custom-class',
    });
    return await modal.present();
  }

  imageLoaded(image: LoadedImage) {
    // show cropper
  }
  cropperReady() {
      // cropper ready
  }
  loadImageFailed() {
      // show message
  }

  goToFromPlugin() {
    this.router.navigate(['from-plugin'])
  }

}
